import org.apache.camel.Processor;
import org.apache.camel.builder.RouteBuilder;

public class Utils extends RouteBuilder {

  @Override
  public void configure() {
    getContext().getRegistry().bind("testUtils", new TestUtils());
  }

  public class TestUtils {

    public String myString(String msg) {
      return "Hello World - " + msg;
    }

    public Processor myProcessor() {
      return e -> e.getMessage().setBody("Hello from Java");
    }
  }
}
